import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import { faPen, faPlus, faTrash } from "@fortawesome/free-solid-svg-icons"
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

function Student() {
    const [med1, setStudent] = useState([]);
    const [totalPrestation, setTotalPrestation] = useState(0);
    const [minPrestation, setMinPrestation] = useState(Number.POSITIVE_INFINITY);
    const [maxPrestation, setMaxPrestation] = useState(Number.NEGATIVE_INFINITY);
    const [currentPage, setCurrentPage] = useState(1);
    const [itemsPerPage] = useState(4);

    useEffect(() => {
        axios.get('http://localhost:8081/')
            .then(res => {
                const studentData = res.data;
                setStudent(studentData);
                // Calcul des valeurs totales, minimum et maximum
                let total = 0;
                let min = Number.POSITIVE_INFINITY;
                let max = Number.NEGATIVE_INFINITY;
                studentData.forEach(data => {
                    const prestation = data.tauxJournalier * data.nombreDeJour;
                    total += prestation;
                    if (prestation < min) min = prestation;
                    if (prestation > max) max = prestation;
                });
                setTotalPrestation(total);
                setMinPrestation(min);
                setMaxPrestation(max);
            })
            .catch(err => console.log(err));
    }, []);

    const indexOfLastItem = currentPage * itemsPerPage;
    const indexOfFirstItem = indexOfLastItem - itemsPerPage;
    const currentItems = med1.slice(indexOfFirstItem, indexOfLastItem);

    const paginate = pageNumber => setCurrentPage(pageNumber);

    const handleDelete = async (numed) => {
        // Affiche une boîte de dialogue de confirmation
        const confirmation = window.confirm("Êtes-vous sûr de vouloir supprimer cet élément ?");

        // Si l'utilisateur clique sur OK (confirmation est true), procédez à la suppression
        if (confirmation) {
            try {
                await axios.delete(`http://localhost:8081/med1/${numed}`);
                window.location.reload();
            } catch (err) {
                console.log(err);
            }
        }
        // Sinon, ne faites rien
    }

    return (
        <div className='d-flex vh-100 bg-secondary justify-content-center align-items-center'>
            <div className='w-65 bg-dark text-light rounded p-3'>
                <h2>Liste d'info medicin</h2>
                <Link to='/ajouter' className='btn btn-success mt-2'><FontAwesomeIcon icon={faPlus} /></Link>
                <table className='table text-light mt-4'>
                    <thead>
                        <tr>
                            <th>Numed</th>
                            <th>Nom</th>
                            <th>Nombre de jour</th>
                            <th>Taux journalier</th>
                            <th>Prestation</th>
                            <th>Action</th>
                        </tr>
                    </thead>
                    <tbody>
                        {currentItems.map((data, i) => (
                            <tr key={i}>
                                <td>{data.numed}</td>
                                <td>{data.nom}</td>
                                <td>{data.nombreDeJour}</td>
                                <td>{data.tauxJournalier}</td>
                                <td>{data.tauxJournalier * data.nombreDeJour}</td>
                                <td>

                                    <Link to={`/update/${data.numed}`} className='btn btn-primary ms-2'>
                                        <FontAwesomeIcon icon={faPen} />
                                    </Link>

                                    <button className='btn btn-danger ms-2' onClick={e => handleDelete(data.numed)} >
                                        <FontAwesomeIcon icon={faTrash} />
                                    </button>
                                </td>
                            </tr>
                        ))}
                    </tbody>
                </table>
                <nav>
                    <ul className='pagination'>
                        {Array.from({ length: Math.ceil(med1.length / itemsPerPage) }).map((_, index) => (
                            <li key={index} className='page-item'>
                                <button onClick={() => paginate(index + 1)} className='page-link'>
                                    {index + 1}
                                </button>
                            </li>
                        ))}
                    </ul>
                </nav>
                <table className='table text-dark bg-white rounded'>
                    <thead>
                        <tr>
                            <th>Minimum</th>
                            <th>Maximum</th>
                            <th>Total</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td><span className='badge text-bg-primary p-1'>{minPrestation}</span></td>
                            <td><span className='badge text-bg-info p-1'>{maxPrestation}</span></td>
                            <td><span className='badge text-bg-info p-1'>{totalPrestation}</span></td>
                        </tr>
                    </tbody>
                </table>
            </div>
        </div>
    );
}

export default Student;
